//import React, { useState } from 'react';
import BotaoMenu from "./componentes/BotaoMenu";

function App(props) {
  //const [agendaVisivel, setAgendaVisivel] = useState('');
  //const [cadastroVisivel, setCadastroVisivel] = useState('');
  //const [avaliacaoVisivel, setAvaliacaoVisivel] = useState('');
  //const [mensalidadeVisivel, setMensalidadeVisivel] = useState('');

  function qualBotao(titulo){
    if(titulo=="Agenda"){
      return console.log("Agendaa");
    } else if(titulo=="Cadastro Paciente"){
      return console.log("Cadastro Pacientee");
    } else if(titulo=="Avaliação Acupuntura"){
      return console.log("Avaliação Acupunturaa");
    } else {
      return console.log("Mensalidade");
    }
  }

  return (
    <div>
      <div className="centralizado">
        <p className="titulo">Clínica Integrità</p>
        <BotaoMenu qualBotao={qualBotao} titulo="Agenda"></BotaoMenu>
        <BotaoMenu qualBotao={qualBotao} titulo="Cadastro Paciente"></BotaoMenu>
        <BotaoMenu qualBotao={qualBotao} titulo="Avaliação Acupuntura"></BotaoMenu>
        <BotaoMenu qualBotao={qualBotao} titulo="Mensalidade"></BotaoMenu>
      </div>
    </div>
  );
}

export default App;
